function Dashboard() {
  return (
    <div className=" mx-auto w-4/5 h-80 justify-center " >

        <div className="text-center justify-items-center">
            <p className="text-red-400 font-serif font-semibold text-2xl ">Mi nombre es Billy</p>
            <p className="font-bold text-slate-900 text-4xl">Creo paginas web y aplicaciones multiplataforma</p>
            <p className=" text-slate-800 font-extralight text-3xl">Soy desarrollador fullstack de paginas web y programador de aplicaciones multiplataforma </p>

            <div className="w-40 p-2 flex mx-auto ">
        <button className="transition duration-150 ease-out py-2 px-4 border-2 border-greens text-black font-medium hover:-translate-y-1 bg-green hover:text-gray-50  ">
          Explorar
        </button>
      </div>
        </div>


    </div>
  );
}

export default Dashboard;
